import Layout from '../components/Layout';
import Link from 'next/link';

const PostLink = ({ title }) => (
  <li>
    <Link href={`/post?title=${title}`}>
      <a></a>
    </Link>
  </li>
)

const Index = () => (
  <Layout>
    Hello Next
  </Layout>
)

export default Index;
